create table product_images
(
    id             int unsigned auto_increment comment '商品图ID'
        primary key,
    product_id     int unsigned                       not null comment '商品ID',
    file_id        int unsigned                       not null comment '图片文件ID',
    file_name      varchar(64)                        not null comment '文件名',
    file_path      varchar(255)                       not null comment '图片文件相对路径',
    file_url       varchar(255)                       not null comment '图片文件URL',
    display_order  int unsigned                       not null comment '排序（顺序）',
    is_cover_image tinyint(1)                         not null comment '是否是封面图',
    created_at     datetime default CURRENT_TIMESTAMP not null,
    updated_at     datetime                           null,
    deleted_at     datetime                           null
)
    collate = utf8mb4_unicode_ci;

create index product_images_product_id_index
    on product_images (product_id);

